import { useState } from "react";

const FunctionalCounter=()=>{
   
    const [counter, setCounter]=useState(0);

    const increament =()=>{
        setCounter(counter)
    }

    return <> 
        
        <div> Counter Value : {counter}</div>
        <div><button onClick={increament}> Increament</button></div>
    
    
      </>

}

export default FunctionalCounter;
